import { Link } from 'react-router-dom';
function EventsPage() {
  const events = [
    { id: 'e1', title: 'Programming for everyone', price: 299.99 },
    { id: 'e2', title: 'Networking for introverts', price: 99.99 },
    { id: 'e3', title: 'Networking for extroverts', price: 99.99 },
    { id: 'e4', title: 'How to be a better person', price: 49.99 },
  ];

  return (
    <ul className="events-list">
      {events.map(event => (
        <li key={event.id} className="events-list-item">
          <Link to={`/products/${product.id}`}>{product.title}</Link>
        </li>
      ))}
    </ul>
  );
}

export default EventsPage;
